using namespace std; 
typedef long long ll;

ll findPlatform(ll arr[], ll dep[], ll n) 
{ 
    sort(arr, arr + n); 
    sort(dep, dep + n); 


    ll plat_needed = 1, result = 1; 
    ll i = 1, j = 0; 

    while (i < n && j < n) { 
        if (arr[i] <= dep[j]) { 
            plat_needed++; 
            i++; 
        } 

        else if (arr[i] > dep[j]) { 
            plat_needed--; 
            j++; 
        } 

        if (plat_needed > result) 
            result = plat_needed; 
    } 

    return result; 
} 

